import React from 'react'
import Slider from 'react-slick';
import slider1 from '../../assets/slider-imgs/spring-collection-2019-desktop.jpg'
import slider2 from '../../assets/slider-imgs/short-sleeves-2019-desktop.jpg'
import slider3 from '../../assets/slider-imgs/jeans-homepage-desktop.jpg'
import './Slider.css';

class SimpleSlider extends React.Component {
    render() {
      var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };
      return (
        <Slider {...settings}>
          <div>
              <img src={slider1}/>
          </div>
          <div>
            <h3>2</h3>
          </div>
          <div>
           <img src={slider2}/>
          </div>
          <div>
          <img src={slider3}/>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
        </Slider>
      );
    }
  }

  export default SimpleSlider
